// FIXME [REDMINE-13073] {A} -- "Configurar Vinculo Organizacional na funcionalida de Monitoramento"
	@SuppressWarnings("unchecked")
	public List<Questionario> recuperarQuestionarioVinculoOrganizacionalFiltro(Long idPessoa) {
		StringBuilder stringBuilder = new StringBuilder("SELECT QUESTIONARIO_.ID_QUESTIONARIO ")
			.append("FROM QUESTIONARIO.QUESTIONARIO QUESTIONARIO_ ")
			.append("JOIN QUESTIONARIO.VINCULO_QUESTIONARIO VINCULO_QUESTIONARIO_ ON QUESTIONARIO_.ID_QUESTIONARIO = VINCULO_QUESTIONARIO_.ID_QUESTIONARIO ")
			.append("JOIN QUESTIONARIO.VINCULO_ORGANIZACIONAL VINCULO_ORGANIZACIONAL_ ON VINCULO_ORGANIZACIONAL_.ID_VINCULO_ORGANIZACIONAL = VINCULO_QUESTIONARIO_.ID_VINCULO_ORGANIZACIONAL ")
			.append("JOIN QUESTIONARIO.PERFIL_PESSOA PERFIL_PESSOA_ ON PERFIL_PESSOA_.ID_VINCULO_ORGANIZACIONAL = VINCULO_ORGANIZACIONAL_.ID_VINCULO_ORGANIZACIONAL ")
			.append("JOIN CORPORATIVO.UNIDADE_ORGANIZACIONAL UNIDADE_ORGANIZACIONAL_ ON UNIDADE_ORGANIZACIONAL_.ID_UNIDADE_ORGANIZACIONAL = VINCULO_ORGANIZACIONAL_.ID_UNIDADE_ORGANIZACIONAL ")
			.append("JOIN CORPORATIVO.PESSOA PESSOA_ ON PESSOA_.ID_PESSOA = PERFIL_PESSOA_.ID_PESSOA ")
			.append("WHERE PERFIL_PESSOA_.ID_PESSOA NOT IN( :idPessoa ) ");
		SQLQuery query = session.createSQLQuery(stringBuilder.toString());
			query.setParameter("idPessoa", idPessoa);
		return query.list();
	}

