// FIXME [REDMINE-13073] {A} -- "Configurar Vinculo Organizacional na funcionalida de Monitoramento"
	public List<VinculoQuestionarioDTO> recuperarQuestionarioVinculoOrganizacionalFiltro(Long idPessoa) {
		StringBuilder stringBuilder = new StringBuilder("SELECT QUESTIONARIO_.ID_QUESTIONARIO, VINCULO_QUESTIONARIO_.ID_VINCULO_QUESTIONARIO ")
			.append("FROM QUESTIONARIO.VINCULO_QUESTIONARIO VINCULO_QUESTIONARIO_ ")
			.append("JOIN QUESTIONARIO.QUESTIONARIO QUESTIONARIO_ ON QUESTIONARIO_.ID_QUESTIONARIO = VINCULO_QUESTIONARIO_.ID_QUESTIONARIO ")
			.append("JOIN QUESTIONARIO.VINCULO_ORGANIZACIONAL VINCULO_ORGANIZACIONAL_ ON VINCULO_ORGANIZACIONAL_.ID_VINCULO_ORGANIZACIONAL = VINCULO_QUESTIONARIO_.ID_VINCULO_ORGANIZACIONAL ")
			.append("JOIN QUESTIONARIO.PERFIL_PESSOA PERFIL_PESSOA_ ON PERFIL_PESSOA_.ID_VINCULO_ORGANIZACIONAL = VINCULO_ORGANIZACIONAL_.ID_VINCULO_ORGANIZACIONAL ")
			.append("WHERE PERFIL_PESSOA_.ID_PESSOA IN :idPessoa ");
		Query query = entityManager.createNativeQuery(stringBuilder.toString());
		query.setParameter("idPessoa", idPessoa);
		List<VinculoQuestionarioDTO> vinculoQuestionarioDTOList = configurarQuestionarioFiltro(query);
		return vinculoQuestionarioDTOList;
	}
	
	// FIXME [REDMINE-13073] {A} -- "Configurar Vinculo Organizacional na funcionalida de Monitoramento"
	@SuppressWarnings("unchecked")
	private List<VinculoQuestionarioDTO> configurarQuestionarioFiltro(Query query) {
		VinculoQuestionarioDTO vinculoQuestionarioDTO = new VinculoQuestionarioDTO();
		List<VinculoQuestionarioDTO> vinculoQuestionarioDTOList = new ArrayList<>();
		List<Object[]> queryResult = query.getResultList();
		List<Questionario> questionarioList = new ArrayList<>();
		for (Object[] resultado : queryResult) {
			Questionario questionario = new Questionario();
			questionario.setId(new BigDecimal(resultado[0].toString()).longValue());
			vinculoQuestionarioDTO.getVinculoQuestionarioList().add(new VinculoQuestionario(new BigDecimal(resultado[1].toString()).longValue(), questionario));
			questionarioList.add(questionario);
		}
		vinculoQuestionarioDTO.setQuestionarioList(questionarioList);
		return vinculoQuestionarioDTOList;
	}
