	@Transactional
	private VinculoOrganizacional recuperarVinculoOrganizacional(List<PerfilPessoa> perfilPessoaList) {
		VinculoOrganizacional vinculoOrganizacional = perfilPessoaList.get(0).getVinculoOrganizacional();
		if(!isVinculoOrganizacionalCadastrado(perfilPessoaList.get(0).getVinculoOrganizacional().getId())) {
			vinculoOrganizacional = gerenciadorVinculoOrganizacional.cadastrarVinculoOrganizacional(vinculoOrganizacionalFactory(perfilPessoaList));
		} else {
			vinculoOrganizacional = recuperarVinculoOrganizacional(vinculoOrganizacional.getId());
		}
		return vinculoOrganizacional;
	}
	
	@Transactional
	private boolean isVinculoOrganizacionalCadastrado(Long id) {
		return gerenciadorVinculoOrganizacional.consultarUnidadeOrganizacionalVinculada(id).size() > 0;
	}
	
	private VinculoOrganizacional vinculoOrganizacionalFactory(List<PerfilPessoa> perfilPessoaList) {
		VinculoOrganizacional vinculoOrganizacionalFactory = new VinculoOrganizacional();
			vinculoOrganizacionalFactory.setDataUltimaAlteracao(recuperarDataUltimaAlteracao());
			vinculoOrganizacionalFactory.setUnidadeOrganizacional(recuperarUnidadeOrganizacional(perfilPessoaList.get(0).getVinculoOrganizacional().getId()));
			vinculoOrganizacionalFactory.setUsuarioUltimaAlteracao(recuperarUsuarioLogado().getLogin());
		return vinculoOrganizacionalFactory;
	}
	
